import React from 'react'
import {Link} from 'react-router-dom'

class Navigation extends React.Component {
  render () {
    return (
      <div>
        <Link to="/">HOME</Link>
        <Link to="/About">ABOUT</Link>
        <Link to="/Projects">PROJECTS</Link>
      </div>
    )
  }
}

export default Navigation
